            self.__OBJECT._CORNER.CornerRadius = UDim.new(0, value)
      elseif property == "Filled" then
            self.__OBJECT._STROKE.Enabled = not value
            self.__OBJECT.BackgroundTransparency = value and 1 - Properties.Transparency or 1
